import React from 'react'
import { useNavigate } from "react-router-dom";

function Radio(props){
    const navigate = useNavigate()

    function linkYT(){
        navigate("/Yearly-Traffic")
    }

    function linkAOV(){
        navigate("/Average-Order")
    }

    function linkWNC(){
        navigate("/Web-Native-Conversion")
    }

    function linkER(){
        navigate("/Return")
    }

    function linkTP(){
        navigate("/Time-Purchased")
    }

    function linkHome(){
        navigate("/Track")
    }



    return(
        <div class="radio-inputs">

        <label class="radio">
            <input className='rc' type="checkbox" name='YearlyTraffic' onChange={linkHome} checked={props.HOME}/>
            <span class="name">Home</span>
        </label>

        <label class="radio">
            <input className='rc' type="checkbox" name='YearlyTraffic' onChange={linkYT} checked={props.YT}/>
            <span class="name">About Me</span>
        </label>

        <label class="radio">
            <input className='rc' type="checkbox"  name='AOV' onChange={linkAOV} checked={props.AOV}/>
            <span class="name">Projects</span>
        </label>


        <label class="radio">
            <input className='rc' type="checkbox" name='WNC' onChange={linkWNC} checked={props.WNC}/>
            <span class="name">Contact</span>
        </label>

        <label class="radio">
            <input className='rc' type="checkbox"  name='ER' onChange={linkER} checked={props.ER}/>
            <span class="name">Estimated ROI</span>
        </label>

        <label class="radio">
            <input className='rc' type="checkbox" name='TP' onChange={linkTP} checked={props.TP}/>
            <span class="name">Time Purchased</span>
        </label>

        </div>
    )
}


export default Radio


